import React from "react";
import { Route } from "react-router-dom";

const SneakersRouter = () => {
  return (
    <Route path="/sneakers">
      <Route path="men" element={<Men />} />
      <Route path="women" element={<Women />} />
      <Route path="kids" element={<Kids />} />
    </Route>
  );
};

export default SneakersRouter;
